import React, { useState } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Register from "./component/Register/Register";
import FavoritCards from "./component/FavoritCards";
// import Login from "./component/Login/Login";
import NavBar from "./component/Navbar/Navbar";
import Cards from "./component/Cards/Cards";
import { ThemeProvider } from "./hooks/DarkMode/DarkModeContext";
import MyCards from "./component/MyCards";
import SandBox from "./component/SandBox";
import getUserContext from "./hooks/getUserContext";

import "./App.css";

function App() {
  const [userInfromation, setUserInformation] = useState(null);
  return (
    <ThemeProvider>
      <getUserContext.Provider value={{ userInfromation, setUserInformation }}>
        <BrowserRouter>
          <NavBar />
          <Routes>
            <Route path="/" element={<Cards />} />
            <Route path="/favCards" element={<FavoritCards />} />
            {/* <Route path="/login" element={<Login />} /> */}
            <Route path="/register" element={<Register />} />
            <Route path="/myCards" element={<MyCards />} />
            <Route path="/sandBox" element={<SandBox />} />
          </Routes>
        </BrowserRouter>
      </getUserContext.Provider>
    </ThemeProvider>
  );
}

export default App;
